import Foundation

class RemoteUrlPresetLocalDataSource {
    private let key = "remoteUrlPresetData"

    var remoteUrlPresetData: [URL] {
        get {
            guard let urlStringArray = UserDefaults.standard.array(forKey: key) as? [String] else { return [] }
            return urlStringArray.compactMap { URL(string: $0) }
        }
        set {
            let urlStringArray = newValue.map { $0.absoluteString }
            UserDefaults.standard.set(urlStringArray, forKey: key)
        }
    }

    init() {
        if UserDefaults.standard.array(forKey: key) == nil {
            self.remoteUrlPresetData = [].compactMap { URL(string: $0) }
        }
    }
}
